script: |
  super -f text -I q4212.spq | sort > q4212.out

inputs:
  - name: q4212.spq
    data: |
      SELECT DISTINCT + - ( COUNT ( * ) ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q4212.out
    data: |
      -9
